import callapi from "../Common/apicall.js";
export default {
  name: "Income",
  props: ['Income'],
  data: function data() {
    return {
      formstate: {},
      temp: null,
      //for number
      visible: true,
      //for number
      model: {
        Income: 500000,
        OtherIncome: 0,
        Bonus: 100000,
        ProvidentFund: 5.0,
        NumberOfChildeBornBefore61: 0,
        NumberOfChildeBorn61Onwards: 0,
        FatherMother: 0,
        HomeInterest: 0,
        FatherInsure: 0,
        Insure: 0,
        PensionInsure: 0,
        HealthInsure: 0,
        ReduceLTF: 0,
        ReduceRMF: 0,
        Donate: 0,
        Other: 0
      },
      result: {
        TaxPayment: 0,
        MaxLTF: 0,
        MaxRMF: 0,
        MaxHealthInsure: 0,
        MaxInsure: 0,
        MaxInsure60: 0,
        MaxRMFInsure60: 0,
        OutputLTF: 0,
        OutputRMF: 0,
        OutputInsure: 0,
        OutputInsure60: 0,
        SavingTax: 0,
        TaxPaymentReduce: 0,
        MaxTaxRateStep: 0,
        BuyLTFSummary: 0,
        BuyRMFSummary: 0,
        BuyInsureSummary: 0,
        BuyHealthInsureSummary: 0,
        BuyInsure60Summary: 0,
        Budget: 0
      }
    };
  },
  mounted: function mounted() {
    if (Object.keys(this.Income).length > 0) {
      this.model = Object.assign({}, this.Income);
    }
  },
  methods: {
    twoDigit: function twoDigit(val) {
      try {
        return val.toFixed(2).toString().replace(/\B(?=(\d{3})+(?!\d))/g, ",");
      } catch (_unused) {
        return '';
      }
    },
    fieldClassName: function fieldClassName(field) {
      if (!field) {
        return "";
      }

      if ((field.$touched || field.$submitted) && field.$valid) {
        return "has-success";
      }

      if ((field.$touched || field.$submitted) && field.$invalid) {
        return "has-danger";
      }
    },
    onSubmit: function onSubmit() {
      var _this = this;

      $('#result').fadeOut(200);

      if (this.formstate.$invalid) {
        return;
      }

      var response = callapi.post(Server + EndPoint, CalculateSavingTaxBySelf, this.model, ocpkey).then(function (response) {
        _this.result.TaxPayment = response.data.TaxPayment;
        _this.result.MaxLTF = response.data.MaxLTF;
        _this.result.MaxRMF = response.data.MaxRMF;
        _this.result.MaxHealthInsure = response.data.MaxHealthInsure;
        _this.result.MaxInsure = response.data.MaxInsure;
        _this.result.MaxInsure60 = response.data.MaxInsure60;
        _this.result.MaxRMFInsure60 = response.data.MaxRMFInsure60;
        _this.result.OutputLTF = response.data.OutputLTF;
        _this.result.OutputRMF = response.data.OutputRMF;
        _this.result.OutputInsure = response.data.OutputInsure;
        _this.result.OutputInsure60 = response.data.OutputInsure60;
        _this.result.SavingTax = response.data.SavingTax;
        _this.result.TaxPaymentReduce = response.data.TaxPaymentReduce;
        _this.result.MaxTaxRateStep = response.data.MaxTaxRateStep;
        _this.result.BuyLTFSummary = response.data.BuyLTFSummary;
        _this.result.BuyRMFSummary = response.data.BuyRMFSummary;
        _this.result.BuyInsureSummary = response.data.BuyInsureSummary;
        _this.result.BuyHealthInsureSummary = response.data.BuyHealthInsureSummary;
        _this.result.BuyInsure60Summary = response.data.BuyInsure60Summary;
        _this.result.Budget = response.data.Budget;

        _this.$emit('ReturnIncomeResult', _this.result);

        $('#result').fadeIn(400);
      }).catch(function (e) {
        _this.errors.push(e);
      });
    },
    Reduce_Click: function Reduce_Click() {
      if ($('#Reduce-Section').css('display') === 'none') {
        $('#Reduce-Section').slideDown(200);
      } else {
        $('#Reduce-Section').slideUp(200);
      }

      event.preventDefault();
    }
  },
  watch: {
    model: {
      immediate: true,
      handler: function handler(newVal, oldVal) {
        this.$emit('ReturnIncome', newVal);
      },
      deep: true
    }
  }
};
